mas, penulisan JSON di php biar ada titlenya gimana yah?
punyaku seperti ini, judulnya ga ada..

<?php
$koneksi = mysqli_connect("localhost","root","root","volleypostrequest");

$sql = "select * from user";

$result = mysqli_query($koneksi, $sql);

if(mysqli_num_rows($result)>0){

$row = mysqli_fetch_assoc($result);
echo json_encode(array("identitas"=> $row['id'],"username"=>$row['username'],"Email"=>$row['email'],"Password"=>$row['password']));
}

?>

atau yang kaya gini, 

<?php
$koneksi = mysqli_connect("localhost","root","root","volleypostrequest") or die("ERROR".mysqli_error($koneksi));

$sql = "select * from user";

$result = mysqli_query($koneksi, $sql) or die ("ERROR".mysqli_error($koneksi));

$identitas = array();
while ($row = mysqli_fetch_assoc($result)){
$identitas[] = $row;
}

echo json_encode($identitas);

mysqli_close($koneksi);
?>

